.ProjectPage {
    width: 100%;
    height: 100%;
    position: relative;
    padding: 0 10%;
    // display: flex;
    // flex-direction: column;
    // align-items: flex-start;
}

    .ProjectPageWrap {
        width: 100%;
        max-width: 1900px;
        // display: flex;
        // justify-content: flex-start;
        // flex-direction: column;
    }






    /* ---- Project Intro --------------- */
    .ProjectPageTitle {
    margin-top: 150px;
    margin-bottom: 30px;
    font-size: 90px;
    display: inline-block;
    }

    .ProjectPageText {
        font-size: 14px;
        width: 100%;
        line-height: 32px;
    }

    .ProjectPageImage {
            border-radius: 2px;
            box-shadow: 5px 5px 10px rgba(0, 0, 0, 0.2);
            transition: all .5s;
    }

        .ProjectPageIntroText {
            max-width: 725px;
            margin-bottom: 40px;
        }

        .ProjectPageLinksWrap {
            width: 250px;
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 40px;
        }

            .ProjectPageLink {
                font-size: 20px;
                text-transform: uppercase;
                font-weight: 900;

            }
                .ProjectPageLink:hover {
                    color: #c0dde1;
                }

            .TextBolder {
                font-weight: 900;
            }


    @media screen and (max-width: 650px){
        .ProjectPageTitle {
            font-size: 50px;
        }

        .ProjectPageIntroText {
            max-width: 100%;
        }
    }
















    /* ---- Project Hero --------------- */
    .ProjectPageImage-Hero {
        width: 100%;
        height: 30vw;
        margin-bottom: 100px;
    }

        @media screen and (max-width: 650px){
            .ProjectPageImage-Hero {
                margin-bottom: 80px;
            }
        }
















    /* ---- Project Section 1 - Side By Side--------------- */
    .ProjectPageSection1 {
        width: 100%;
        display: flex;
        align-items: center;
        margin-bottom: 100px;
    }

        .ProjectPageSection1-TextWrap {
            width: 50%;
            display: flex;
            justify-content: center;
            flex-direction: column;
            align-items: flex-start;
            padding-right: 40px;

        }

        .ProjectPageSection-Title {
            font-size: 20px;
            text-transform: uppercase;
            font-weight: 700;
            margin-bottom: 30px;
        }

        .ProjectPageSection-Text {
            width: 100%;
            font-weight: 400;
            font-size: 16px;
            max-width: 530px;
            line-height: 32px;
        }

        .ProjectPageSection1ImageWrap {
            width: 50%;
            height: 20vw;
        }

    @media screen and (max-width: 900px){
        .ProjectPageSection1 {
            flex-direction: column;
            margin-bottom: 80px;
        }
        .ProjectPageSection1-TextWrap {
            width: 100%;
            max-width: 100%;
            margin-bottom: 40px;
            padding: 0;
        }
        .ProjectPageSection1-Text {
            width: 100%;
        }
        .ProjectPageSection1ImageWrap {
            width: 100%;
            height: 40vw;
        }
    }



    /* ---- Desktop View & Build Description--------------- */

        .SwitchSection2-Section3Mobile {
            width: 100%;
            display: flex;
            flex-direction: column;
        }

        @media screen and (max-width: 800px){
            .SwitchSection2-Section3Mobile {
                flex-direction: column-reverse;
            }
        }















            /* ---- Project Section 2 - Desktop View --------------- */
            .ProjectPageSection2 {
                width: 100%;
                height: 80vh;
                margin-bottom: 80px;
                position: relative;
            }

                .ProjectPageSection2-DesktopWindow {
                    width: 100%;
                    height: 100%;
                }

                    .DesktopWindow-Top {
                        width: 100%;
                        height: 15%;
                        background-color: #212121;
                    }

                        .DesktopWindow-TopBrowser {
                            width: 100%;
                            height: 50%;
                            background-color: #2B2B2B;
                            position: relative;
                            display: flex;
                            justify-content: flex-start;
                            align-items: center;
                            box-shadow: 2px 2px 10px  rgba(0, 0, 0, .05);
                        }

                            .DesktopWindowBrowser-Menu {
                                width: 50px;
                                height: 100%;
                                margin-left: 20px;
                                display: flex;
                                justify-content: space-between;
                                align-items: center;
                                transition: all .5s;
                            }

                                .DesktopWindowBrowser-MenuIcon {
                                    width: 12px;
                                    height: 12px;
                                    border-radius: 50%;
                                    transition: all .5s;
                                }

                                    #MenuIcon1 {
                                        background-color: rgb(205, 85, 85);
                                    }

                                    #MenuIcon2 {
                                        background-color: rgb(218, 204, 53);
                                    }

                                    #MenuIcon3 {
                                        background-color: rgb(114, 225, 81);
                                    }

                    .DesktopWindow-ImageWrap {
                        width: 100%;
                        height: 80%;
                        background-color: rgb(14, 14, 14);
                    }

                        .DesktopWindow-Image {
                            width: 100%;
                            height: 100%;

                        }

                    .DesktopWindow-Bottom {
                        width: 100%;
                        height: 5%;
                        background-color: #212121;
                    }

        @media screen and (max-width: 1000px){
            .ProjectPageSection2 {
                height: 38vw;
            }
            .DesktopWindowBrowser-Menu {
                width: 40px;
            }
            .DesktopWindowBrowser-MenuIcon {
                width: 8px;
                height: 8px;
            }
        }















    /* ---- Project Section 3 - Build Description --------------- */
        .ProjectPageSection3 {
            width: 100%;
            position: relative;
            margin-bottom: 40px;
        }

            .ProjectPageSection3-Text {
                width: 100%;
                margin-bottom: 40px;
            }

            .ProjectPageSection3LanguagesWrap {

            }

                .ProjectPageSection3LanguagesRow {
                    width: 350px;
                    display: flex;
                    justify-content: space-between;
                    margin-bottom: 18px;
                    flex-wrap: wrap;
                }

                    .ProjectPageSection3Language {
                        font-size: 18px;
                        font-weight: 700;
                    }

        @media screen and (max-width: 900px){
            .ProjectPageSection3-Text {
                width: 100%;
                max-width: 100%;
            }
        }

        @media screen and (max-width: 800px){
            .ProjectPageSection3 {
                margin-bottom: 40px;
            }
        }

        @media screen and (max-width: 470px){
            .ProjectPageSection3LanguagesRow {
                width: 100%;
            }   
        }

















    /* ---- Project Section 4 - Responsive Displays --------------- */
    .ProjectPageSection4 {
        width: 100%;
        position: relative;
        margin-bottom: 100px;
    }

        .ProjectPageSection4Wrap {
            width: 100%;
            display: flex;
        }

            .ProjectPageSection4Left {
                width: 65%;
                display: flex;
                flex-direction: column;
                align-items: flex-start;
                justify-content: center;
            }

                .ProjectPageSection4-Text {
                    margin-bottom: 10px;
                    max-width: 530px;
                }

                .ProjectPageSection4-DisplaysWrap {
                    width: 100%;
                    height: 35%;
                    display: flex;
                    justify-content: space-between;
                    align-items: flex-end;
                    position: relative;
                    opacity: .95;
                }

                    .ProjectPageSection4-Display1 {
                        width: 45%;
                        height: 60%;
                        position: relative;
                        display: flex;
                        flex-direction: column;


                    }
                        .ProjectPageSection4-DisplayHeader {
                            width: 100%;
                            height: 10%;
                            background-color: #2d2d2d;
                        }



                     .ProjectPageSection4-DisplayDisplay {
                            width: 100%;
                            height: 90%;
                            position: relative;
                        }

                    .ProjectPageSection4-Display2 {
                        width: 30%;
                        height: 45%;
                        position: relative;

                    }

                    .ProjectPageSection4-Display3 {
                        width: 10%;
                        height: 35%;
                        position: relative;
                    }

                    .ProjectPageSection4-Display4 {
                        width: 4%;
                        height: 22%;
                        position: relative;
                    }

            .ProjectPageSection4Right {
                width: 35%;
                height: 50vw;
                display: flex;
                justify-content: center;
                align-items: center;
            }

                .ProjectPageSection4MobileDisplay {
                    width: 80%;
                    height: 90%;
                    opacity: .95;
                }


        @media screen and (max-width: 800px){
            .ProjectPageSection4 {
                margin-bottom: 80px;
            }
            .ProjectPageSection4Wrap {
                flex-direction: column;
            }
            .ProjectPageSection4Left {
                width: 100%;
            }
            .ProjectPageSection4-DisplaysWrap {
                display: none;
            }
            .ProjectPageSection4Right {
                width: 100%;
                height: 100vw;
            }
            .ProjectPageSection4MobileDisplay {
                width: 50%;
            }
            .ProjectPageSection4-Text {
                margin-bottom: 10px;
                max-width: 100%;
            }
        }











    /* ---- Project Section 5 - EMC BreakDown --------------- */
        .WebAppWalkThrough {
            width: 100%;
            margin-bottom: 100px;
        }

            .WebAppWalkThroughImageWrap {
                width: 100%;
                display: flex;
                align-items: center;
                justify-content: center;
                margin-top: 40px;
            }

                .WebAppWalkThrough-Image1 {
                    width: 30%;
                    height: 50vw;
                    max-height: 700px;
                    margin: 20px;
                }

                .WebAppWalkThrough-Image2 {
                    width: 30%;
                    height: 50vw;
                    max-height: 700px;
                    margin: 20px;
                }












    /* ---- Project Closing --------------- */
        .ProjectPage-Closing {
            width: 100%;
            margin-top: 60px;
            margin-bottom: 100px;
        }

            .ProjectPage-ClosingText {
                font-size: 14px;
                font-weight: 300;

            }

            .ProjectPage-ClosingProjectTitle {
                font-size: 90px;
                font-weight: 900;
            }

                .ProjectPage-ClosingLink:hover {
                    color: #c0dde1;
                }

        @media screen and (max-width: 1000px){
            .ProjectPage-Closing {
                margin-top: 0;
            }
            .ProjectPage-ClosingProjectTitle {
                font-size: 12vw;
                margin: 1.3vw 0;
            }
        }














    /* ---- Footer --------------- */
        .FooterProject {
            position: relative;
            padding-left: 0;
        }
